import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
    photoCard: {
        width: '100%',
        height: 200,
        borderRadius: 10,
        boxShadow: '0px 5px 20px 0px grey'
    },
    infoCard: {
        width: '100%',
        height: 200,
        borderRadius: 10,
        boxShadow: '0px 5px 20px 0px grey'
    }
})

export default useStyles
